import React from 'react';
import PropTypes from 'prop-types';

//app
import styles from './DmsDocDetailsTooltip.styles';
import * as utils from 'utils';
import config from 'config';

//mui
import { makeStyles, Grid, Box } from '@material-ui/core';

DmsDocDetailsTooltip.propTypes = {
  data: PropTypes.arrayOf(PropTypes.object).isRequired
}

export default function DmsDocDetailsTooltip({ data }) {

  const classes = makeStyles(styles, { name: 'DmsDocDetailsTooltip' })();

  return (
    <div className={classes.root}>
      <Box mt={1} mb={2} mr={2} width="50%">
        <Grid>
          {`Name: ${data?.documentName}`}
        </Grid>
        <Grid>
          {`Document Version: ${data?.documentVersion}`}
        </Grid>
        <Grid>
          {`Created By: ${data?.createdByName}`}
        </Grid>
        <Grid>
          {`Created Date ${utils.string.t('format.date', { value: { date: data?.createdDate, format: config.ui.format.date.text } })}`}
        </Grid>
        <Grid>
          {`Updated Date: ${utils.string.t('format.date', { value: { date: data?.updatedDate, format: config.ui.format.date.text } })}`}
        </Grid>
        <Grid>
          {`Updated Date: ${utils.string.t('format.date', { value: { date: data?.fileLastModifiedDate, format: config.ui.format.date.text } })}`}
        </Grid>
        <Grid>
          {`Document Type: ${data?.documentTypeDescription}`}
        </Grid>
      </Box>
      <Box width="50%" mt={1} mb={2}>
        <Grid>
          {`Reference ID: ${data?.referenceId}`}
        </Grid>
        <Grid>
          {`Cat Codes ID: ${data?.catCodesID}`}
        </Grid>
        <Grid>
          {`Department ID: ${data?.departmentId}`}
        </Grid>
        <Grid>
          {`Section Type: ${data?.sectionType}`}
        </Grid>
        <Grid>
          {`Source: ${data?.srcApplication}`}
        </Grid>
      </Box>
    </div>
  )
}
